import React, {useEffect, useState} from "react";

function room(){

    const[uuidV4,setUuidV4] = useState("");
    useEffect(()=>{
        fetch("http://localhost:9000/room")
            .then(res =>{
                res.text();
            }).then(res =>{
                setUuidV4(res);
                console.log(res)
            })
    })

    return (
        <div id="video-grid"><h1>TTTTT</h1></div>
        
    );
}
